// src/components/HomePage.js
import React from 'react';
import { Container, Typography, Box } from '@mui/material';

const HomePage = () => {
  return (
    <Container>
      <Box mt={4} textAlign="center">
        <Typography variant="h2">Welcome to NailTique Closter</Typography>
        <Typography variant="h5" mt={2}>
          Your go-to place for beautiful nails and relaxing experiences.
        </Typography>
      </Box>
    </Container>
  );
};

export default HomePage;
